import styled from 'styled-components';
import MainPageSections from '../../components/common/mainPageSections'

const MainPage = () => {
  const sections = [
    {
      img:'',
      title:'',
      text:''
    }, {
      img:'',
      title:'',
      text:''
    }, {
      img:'',
      title:'',
      text:''
    },
  ]
  return(
    <MainPageBox>
      <MainPageBackground>
        <MainPageTextBox>
          <MainPageTitle>직장인의 커리어 여정을<br/> 행복하게, 원티드</MainPageTitle>
          <MainPageText>지금 원티드와 커리어 여정을 시작하세요.</MainPageText>
          <MainPageBtn>지금 시작하기</MainPageBtn>
        </MainPageTextBox>
        </MainPageBackground>
      <MainPageSections />
    </MainPageBox>
  );
}

const MainPageBox = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
`
const MainPageBackground = styled.div`
  position: relative;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  width: 100%;
  height: 550px;
  -webkit-box-align: center;
  -ms-flex-align: center;
  align-items: center;
  -webkit-box-pack: center;
  -ms-flex-pack: center;
  justify-content: center;
  background: 50%/cover no-repeat #eee url(https://static.wanted.co.kr/images/newintro/pc.webp);
`
const MainPageTextBox = styled.div`
  width: 940px;
  -webkit-box-align: center;
  align-items: center;
  -webkit-box-pack: center;
  justify-content: center;
`
const MainPageTitle = styled.div`
  font-size: 48px;
  line-height: 62px;
  margin-bottom: 20px;
  font-weight: 600;
`
const MainPageText = styled.div`
  font-size: 18px;
  line-height: 28px;
  margin-bottom: 30px;
  font-weight: 500;
`
const MainPageBtn = styled.button`
  height: 64px;
  width: 230px;
  border-radius: 32px;
  background-color: #3a68f9;
  color: #fff;
  font-size: 20px;
  line-height: 17px;
  border: 0;
`
export default MainPage;
